import React from 'react';

const LoginPresenter = (props) => {
    return (
        <div>
            <input placeholder="아이디를 입력하시오. " value={this.props.userId} /><br />
            <input placeholder="비밀번호를 입력하시오." value={this.props.userPassword} /><br />
            <button>로그인</button>
        </div>
    );
};

export default LoginPresenter;
